import React from "react";
import "./Quote.css";

const Quote = () => {
    return ( <
        div className = "quote" >
        <
        div className = "box" >
        <
        h3 > ‘Fragrance is the voice of inanimate things.’ <
        /h3> <
        p > Jalāl ad - Dīn Muhammad Rūmī < /p> <
        /div> <
        /div>
    );
};

export default Quote;
